import React from 'react'
import Pentagon from "../images/bg-triangle.svg";
import paper from '../images/icon-paper.svg'
import rock from '../images/icon-rock.svg'
import scissors from '../images/icon-scissors.svg'
import { connect } from "react-redux";
import  '../Style/Triangle.css'

function Triangle({setUserChoice}) {
  return (
    <div>
      <div className="triangle"> <img src={Pentagon}/></div>
      <div onClick={(e) =>setUserChoice(e.target.className)}><img className="paper" src={paper}/> </div>
      <div className="scissors__container circle" onClick={(e) =>setUserChoice(e.target.className)}><img className="scissors" src={scissors}/> </div>
      <div onClick={(e) =>setUserChoice(e.target.className)}><img className="rock" src={rock}/> </div>
    </div>
  )
}


const mapDispatchToProps = (dispatch) => {
  return {
    setUserChoice: (choice) => dispatch({ type: "SET_USER_CHOICE", payload: { choice } }),
  };
};

export default connect(null, mapDispatchToProps)(Triangle);
